<!DOCTYPE html>
<html xmlns:wicket="http://wicket.apache.org">
<head>
<wicket:head>
	<title>Wicket - jQuery UI: tabs widget</title>
</wicket:head>
</head>
<body>
	<wicket:extend>
		<div wicket:id="ExtTabs">

			</div>
		</div>
	</wicket:extend>
</body>
</html>
